import React , {Component} from 'react'

export default class Skins extends Component {


    render(){
        let skins = this.props.skins
        return(
            <div id="carouselExampleFade" class="carousel slide carousel-fade" data-ride="carousel">
                <div class="carousel-inner">
                    {skins.map(skin => {
                        let className = skins.indexOf(skin) === 0 ? "active" : "unactive"
                        return(
                            <div class={`carousel-item ${className}`}>
                                <img src={skin.image} class="d-block w-100" alt={skin.name}/>
                            </div>
                        )
                    })}
                </div>
                <a class="carousel-control-prev" onClick>
                    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span class="sr-only">Previous</span>
                </a>
                <a class="carousel-control-next">
                    <span class="carousel-control-next-icon" aria-hidden="true"></span>
                    <span class="sr-only">Next</span>
                </a>
            </div>
        )
    }
}
